require('js-marker-clusterer');


var mapElement 	= document.getElementById('storelocatormap'),
	markers 	= [],
	storeData,
	geocoder,
	address,
	latv,
	lngv;


var bornStoreLocator = {
    init: function () 
    	{
			var  initStoreMap = function() {	
				if(!mapElement){
					return;
				}
				var mapOptions = {
			        zoom: 11,
					disableDefaultUI: true,
				    zoomControl: true,					
			        center: new google.maps.LatLng(-33.865143, 151.209900),
			        styles: stylesNY

			    };
			    	
					window.sdsmap = new google.maps.Map(mapElement, mapOptions);       
			}

			initStoreMap();

		},


	getDistance : function(calType, coord)
		{

			switch (calType) {
				case 'getlatlng':
					var geocoder = new google.maps.Geocoder(),
						address = coord,
						loc=[];

				    	geocoder.geocode( { 'address': address}, function(results, status) {
				    	
							if (status == google.maps.GeocoderStatus.OK) {

						        loc[0]	=results[0].geometry.location.lat();
						        loc[1]	=results[0].geometry.location.lng();

						    } else {
						        console.log("Geocode was not successful for the following reason: " + status);
						    }

					    });

		    		return loc;

					break;
				default:
					var searchlocation 		= new google.maps.LatLng(coord.a.lat, coord.a.lon),
						store_lat_lng 		= new google.maps.LatLng(coord.b.lat, coord.b.lon),
						distance_fromstore 	=  google.maps.geometry.spherical.computeDistanceBetween(searchlocation, store_lat_lng),
						distance 			= (distance_fromstore / 1000).toFixed(2);
					
					return distance;
			}

		},


	geocodeAddress : function(map, bounds, locations, i, mylocation)
		{

			/*
			*
			* Please consider query limits for this service, either uses db transactions
			* to record queries or consider upgrading to the Google premium plan for higher 
			* rate limits. More Here:
			* https://developers.google.com/maps/premium/usage-limits
			*
			*/

			var data 			= locations[i];
			var geocoder 		= new google.maps.Geocoder();
	        var myLatLng 		= new google.maps.LatLng(data.storelat, data.storelon);
			var infowindow 		= new google.maps.InfoWindow({content: contentString});
			var thedistance,
				mapDistance,
				marker;

		    geocoder.geocode(
		    {
				componentRestrictions: {
					country: 'AU',
					postalCode: mylocation
				}
			},
		    function (results, status) {

		        if (status == google.maps.GeocoderStatus.OK) {
					
					var mapDistance  = '';
					var distancecalc = {
						a:{
							lat: latv,
							lon: lngv
						},
						b:{
							lat: data.storelat,
							lon: data.storelon
						}
									};
				 	latv 		= results[0].geometry.location.lat();
					lngv 		= results[0].geometry.location.lng();
					thedistance = bornStoreLocator.getDistance('other',distancecalc);
					

					if(isNaN(thedistance)){
						mapDistance = '';
					}else{ 
						document.getElementById('distance-st-'+data.storeid).innerHTML=thedistance+' KM';
						mapDistance = '<span class="distance">'+thedistance+' KM<span><br>';
					}

		        } else {
		            console.log("geocode of " + address + " failed:" + status);
		        }
		    }
		    );

	        var contentString = 
	            '<div class="store-loc">'+
		            '<div id="siteNotice">'+
		            '</div>'+
		            '<div class="store-loc--bodyContent">'+ 
	            		'<h1 class="store-loc--name">'+ data.storename + '</h1>'+
			            '<div class="store-loc--address">'+ 
			            	mapDistance +
				            data.addressa + 
				            data.city + ', <br>' +
				            data.statecode + ', ' +
				            data.postalcode + 
			            '</div>'+
			            '<div class="store-loc--phone-direction">'+ 
				            '<div class="store-loc--phone">'+ 
				            	data.storephone + 
				            '</div>'+
				            '<div class="store-loc--directions">'+ 
				           	 	'<a href="https://www.google.com/maps/dir//'+data.addressa+'+'+data.city +'+'+data.postalcode+'" target="_blank">Directions</a>'+
				            '</div>'+
			            '</div>';
		            '</div>';
	            '</div>';

	        	marker = new google.maps.Marker({
		            position: myLatLng,
					icon:  'data:image/png;base64,',
	                // no need to get fancy here but if we do decide to ...
	                //animation: google.maps.Animation.DROP,
		            map: map,
		            title: data.storename,
		        });

				google.maps.event.addListener(marker, 'click', bornStoreLocator.getInfoCallback(map, contentString));
				markers.push(marker);
				bounds.extend(myLatLng);

		},

	justAddress : function(map, bounds, locations, i)
		{
			var distancecalc 	= {}
			var mapDistance 	= ''
	    	var data 			= locations[i];
	        var myLatLng 		= new google.maps.LatLng(data.storelat, data.storelon);
	        var infowindow 		= new google.maps.InfoWindow({content: contentString});

		        var contentString = 
		            '<div class="store-loc">'+
			            '<div id="siteNotice">'+
			            '</div>'+
			            '<div class="store-loc--bodyContent">'+ 
		            		'<h1 class="store-loc--name">'+ data.storename + '</h1>'+
				            '<div class="store-loc--address">'+ 
				            	mapDistance +
					            data.addressa + 
					            data.city + ', <br>' +
					            data.statecode + ', ' +
					            data.postalcode + 
				            '</div>'+
				            '<div class="store-loc--phone-direction">'+ 
					            '<div class="store-loc--phone">'+ 
					            	data.storephone + 
					            '</div>'+
					            '<div class="store-loc--directions">'+ 
					           	 	'<a href="https://www.google.com/maps/dir//'+data.addressa+'+'+data.city +'+'+data.postalcode+'" target="_blank">Directions</a>'+
					            '</div>'+
				            '</div>';
			            '</div>';
		            '</div>';

		        var marker = new google.maps.Marker({
		            position: myLatLng,
					icon:  'data:image/png;base64,',
	                //animation: google.maps.Animation.DROP,
		            map: map,
		            title: data.storename,
		        });
		        google.maps.event.addListener(marker, 'click', bornStoreLocator.getInfoCallback(map, contentString));

		    	markers.push(marker);
				bounds.extend(myLatLng);

		},


	getInfoCallback : function(map, content) 
		{
		    var infowindow = new google.maps.InfoWindow({content: content});
			infowindow.close();
		    return function() {
		            infowindow.setContent(content); 
		            infowindow.open(map, this);
			};
		},


    storeResults: function () 
    	{

			var  initStoreMap = function() 
					{	
						if(!mapElement){
							return;
						}
						storeData = [];
						var storeItems = document.getElementsByClassName('storeItem');
						for (var i = 0, len = storeItems.length; i < len; i++) {
						    storeData.push(storeItems[i].dataset);
						};
					}

			var setMarkers = function(map, locations, mylocation)
					{

							var	bounds = new google.maps.LatLngBounds();

							for (var i = 0; i < locations.length; i++) {

								if(mylocation)
    							bornStoreLocator.geocodeAddress(map, bounds, locations, i, mylocation);
    							else
    							bornStoreLocator.justAddress(map, bounds, locations, i);
								
		    				}
							
							var options 		= {imagePath: 'https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m'};
							var markerCluster 	= new MarkerClusterer(map, markers, options);
							map.fitBounds(bounds);

					}

			var initialize = function() 
					{
						
					    var mapOptions = {   
						    zoom: 14,
						    center: new google.maps.LatLng(0, 0),
					        disableDefaultUI: true,
					        mapTypeControl: false,
						    scaleControl: true,
						    zoomControl: true,
							zoomControlOptions:
								{
									position: google.maps.ControlPosition.RIGHT_TOP
								},
							styles: stylesNY

					    };
					
						initStoreMap(); 

					    var map 		= new google.maps.Map(mapElement, mapOptions);
						var listener 	= google.maps.event.addListener(map, "idle", function() { 
						  if (map.getZoom() > 14) map.setZoom(14); 
						  google.maps.event.removeListener(listener); 
						});

						//var postalcode = '92691';
						var url_string 	= window.location.href;
						var url 		= new URL(url_string);
						var postalcode 	= url.searchParams.get("dwfrm_storelocator_postalCode");

					    setMarkers(map, storeData, postalcode);
					}


			initialize();

		},

	singleMap: function()
		{

		    var searchzip 	= mapElement.dataset.searchzip,
				storelat 	= mapElement.dataset.storelat,
				storelon 	= mapElement.dataset.storelon,
				storename 	= mapElement.dataset.storename,
				addressa 	= mapElement.dataset.addressa,
				storephone 	= mapElement.dataset.storephone,
				statecode 	= mapElement.dataset.statecode,
				postalcode 	= mapElement.dataset.postalcode,
				storeid 	= mapElement.dataset.storeid,
				city 		= mapElement.dataset.city;

		    var mapOptions = {
		        zoom: 15,
		        center: new google.maps.LatLng(storelat, storelon), // New York
		        styles: stylesNY
		    };

		    var map = new google.maps.Map(mapElement, mapOptions);

			var geocoder = new google.maps.Geocoder(),
					latv,
					lngv;

	    	geocoder.geocode( 
	    		{
					componentRestrictions: {
						country: 'AU',
				    	postalCode: searchzip
				  	}
				}, 
				function(results, status) {

      				if (status == google.maps.GeocoderStatus.OK) {
				        latv =results[0].geometry.location.lat();
				        lngv =results[0].geometry.location.lng();
				    } else {
				        console.log("Geocode was not successful for the following reason: " + status);
				    }

					var distancecalc = {
						a:{
							lat: latv,
							lon: lngv
						},
						b:{
							lat: storelat,
							lon: storelon
						}
					};
					var mapDistance = '';
					var thedistance = bornStoreLocator.getDistance('other',distancecalc);
					if(isNaN(thedistance)){
						mapDistance = '';
					}else{ 
						document.getElementById('distance-st-'+storeid).innerHTML=thedistance+' KM';
						mapDistance = '<span class="distance">'+thedistance+' KM<span><br>';
					}
			        var contentString = 
			            '<div class="store-loc">'+
				            '<div id="siteNotice">'+
				            '</div>'+
				            '<div class="store-loc--bodyContent">'+ 
			            		'<h1 class="store-loc--name">'+ storename + '</h1>'+
					            '<div class="store-loc--address">'+ 
					            	mapDistance +
						            addressa + 
						            city + ', <br>' +
						            statecode + ', ' +
						            postalcode + 
					            '</div>'+
					            '<div class="store-loc--phone-direction">'+ 
						            '<div class="store-loc--phone">'+ 
						            	storephone + 
						            '</div>'+
						            '<div class="store-loc--directions">'+ 
						           	 	'<a href="https://www.google.com/maps/dir//'+addressa+'+'+city +'+'+postalcode+'" target="_blank">Directions</a>'+
						            '</div>'+
					            '</div>';
				            '</div>';
			            '</div>';

					var infowindow = new google.maps.InfoWindow({
					    content: contentString
					  });

	                var marker = new google.maps.Marker({
	                    position: new google.maps.LatLng(storelat, storelon),
						animation: google.maps.Animation.DROP,
	                    icon: customicon,
	                    map: map,
	                    title: 'SDS'
	                });

			        window.addEventListener('load', function() {
			          infowindow.open(map, marker);
			        });

				}
			);
		}
}

exports.init = function () {

	var storeLocatorEmpty 	= document.getElementsByClassName('storelocator--results-empty');
	var storeLocatorDetails = document.getElementsByClassName('store-locator-details');
	var storeLocatorResults = document.getElementsByClassName('storelocator--main-results');

    if (storeLocatorEmpty.length > 0) {
        bornStoreLocator.init();
    } else if (storeLocatorDetails.length > 0) {
        bornStoreLocator.singleMap();
    } else if (storeLocatorResults.length > 0) {
        bornStoreLocator.storeResults();
    } 
};
